import React, { Component } from 'react';
import { View } from 'react-native-web';
import {Camera} from 'expo-camera';

class MyCamera extends Component{
    constructor(props){
        super(props);
        this.state = {}
    }
    componentDidMount(){
        Camera.requestCameraPermissionsAsync()
          .then(()=>{
               this.setState({
                   permission: true,
               })
          })
          .catch( e => console.log(e))          
      }


    render(){
        return(
            <View>

            </View>
        )
    }
}
